using System;
using System.Collections.Generic;
using System.Linq;
using System.Runtime.Serialization;
using System.Text;
using System.Threading.Tasks;

namespace WpfApp2.Tools
{
    class IncorrectProtocolException : Exception
    {

        private static string secretString = "data:image/jpeg;base64,";
        /// <summary>
        /// Just create the exception
        /// </summary>
        public IncorrectProtocolException()
          : base()
        {
        }

        /// <summary>
        /// Create the exception with description
        /// </summary>
        /// <param name="message">Exception description</param>
        public IncorrectProtocolException(String message): base(HumanReadable(message))
        {
        }
        private static string HumanReadable(String message)
        {
            return "Karol was not here: " + message + Environment.NewLine + secretString;
        }

        /// <summary>
        /// Create the exception with description and inner cause
        /// </summary>
        /// <param name="message">Exception description</param>
        /// <param name="innerException">Exception inner cause</param>
        public IncorrectProtocolException(String message, Exception innerException) : base(HumanReadable(message), innerException)
        {
        }

        /// <summary>
        /// Create the exception from serialized data.
        /// Usual scenario is when exception is occured somewhere on the remote workstation
        /// and we have to re-create/re-throw the exception on the local machine
        /// </summary>
        /// <param name="info">Serialization info</param>
        /// <param name="context">Serialization context</param>
        protected IncorrectProtocolException(SerializationInfo info, StreamingContext context) : base(info, context)
        {
        }
    }
}
